import React from "react";

const Image = () => {
  return (
    <div>
      <div className="inline-flex flex-col h-auto w-auto">
        <img className="" src="/image1.png" alt=""></img>
        <span>Tata Steel TMT</span>
        <svg
          width="55"
          height="21"
          viewBox="0 0 55 21"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <rect width="55" height="21" rx="4" fill="#E26D5A" />
        </svg>
      </div>
    </div>
  );
};

export default Image;
